import React from 'react'

 const Displaynews = ({article}) => {
  return (
    <div>
        <div className='news-box'>
        {article.title}<br />
        {article.description}
        <img src={article.urlToImage} alt={article.title} width="300" height="200" />
        </div>
        
    </div>
  )
}

export default Displaynews;
